import math

def is_prime(num):
    if num <= 2:
        return False
    for i in range(2, int(math.sqrt(num)) + 1):
        if num % i == 0:
            return False
    return True

def generate_sequence(k, n):
    sequence = []
    primes = []
    for i in range(k, n + 1):
        sequence.append(i)
        sequence.append(i ** 2)
        sequence.append(i ** 3)
        if is_prime(i):
            primes.append(i)
    return (sequence, primes)

